DROP TABLE IF EXISTS `helpdesk_supports`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `helpdesk_supports` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `staff_id` bigint unsigned DEFAULT NULL,
  `remark` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `helpdesk_request_id` bigint unsigned DEFAULT NULL,
  `status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Pending',
  `alter_staff_id` bigint unsigned DEFAULT NULL,
  `valid_from` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `valid_until` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `helpdesk_supports_helpdesk_request_id_foreign` (`helpdesk_request_id`),
  KEY `helpdesk_supports_alter_staff_id_foreign` (`alter_staff_id`),
  KEY `helpdesk_supports_staff_id_foreign` (`staff_id`),
  CONSTRAINT `helpdesk_supports_alter_staff_id_foreign` FOREIGN KEY (`alter_staff_id`) REFERENCES `staff` (`id`),
  CONSTRAINT `helpdesk_supports_helpdesk_request_id_foreign` FOREIGN KEY (`helpdesk_request_id`) REFERENCES `helpdesk_requests` (`id`),
  CONSTRAINT `helpdesk_supports_staff_id_foreign` FOREIGN KEY (`staff_id`) REFERENCES `staff` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=92 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
